    compare_one(1, "2,3")   "2,3"
    compare_one("5,1", "6")   "6"
    compare_one("1", 1)   None
    """

    if type(a) == int and type(b) == int:
        if a > b:
            return a
        elif a < b:
            return b
        else:
            return None
    elif type(a) == float and type(b) == float:
