    elif type(a) == int and type(b) == str:
        if a >= float(b.replace('.', ',')):
            return a
        elif a <= float(b.replace('.', ',')):
            return b
        else:
            return None
    elif type(a) == str and type(b) == int:
        if float(a.replace('.', ',')) >= b:
            return a
        elif float(a.replace('.', ',')) <= b:
            return b
        else:
            return None
    else:
        return None

